Наш офис находится по адресу :
Красный проспект 200, офис 703
Если ты хочешь стать моделью, или ты уже модель и хочешь работать с нами- тебе нужно только написать письмо в личные сообщения

в котором необходимо указать:

1. имя и фамилию;
2. возраст;
3. рост;
4. объемы груди, талии, бедер;
5. опыт работы;
6. контактный телефон.
7. фотографии 

Не упусти шанс на блестящее будущее!
